Ho deciso: mollo tutti i miei progetti e vado a fare il TUAREG.

Vantaggi:
- una foglia di menta racchiude in se tutto l’esame di farmacologia;
- se qualcuno ti sta sul cazzo e ti manca di rispetto puoi tagliargli la testa con una sciabolata senza problemi;
- vita senza stress e relax totale;
- abbronzatura gratis tutto l’anno e mare cristallino;
- puoi avere 5/6 mogli, tutte fedeli, solerti e tutte vanno d’accordo l’una con l’altra senza gelosie. 
Svantaggi: - la vaccinazione consiste nell’iniettarsi veleno di serpente: probabilità di morte 35%. Comunque se sopravvivi il sistema immunitario diventa super sajan e hai un’aspettativa di vita di circa 80 anni considerando lo stile di vita sano e l’ assenza agenti cancerogeni;
- se stai sul cazzo a qualcuno ti taglia la testa senza particolari problemi;
- l’animale domestico non è la micina che ti viene sulle gambe la sera bensì un cammello di 500 kg puzzolente e bavoso;
- niente sushi e pizza;
- hai 5/6 suocere;
